import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './App.css';

import App from './components/App';
import Welcome from './components/Welcome';

const Index = props => {
  return (
    <div className="App">
      <App />
    </div>
  )
}

ReactDOM.render(<Index />, document.getElementById('root'));
